use strict;
use Data::Dumper;

my $data = [];
my $matches = 0;

foreach my $line (<DATA>) {
    chomp $line;
    push @$data, [(split //, $line)]
}

for (my $i = 0; $i <= $#$data; $i++) {
    for (my $j = 0; $j <= $#{$data->[$i]}; $j++) {
        if ($data->[$i]->[$j] eq 'A' && $i > 0 && $i < $#$data && $j > 0 && $j < $#{$data->[$i]}) {
            my $nw = [$i - 1, $j - 1];
            my $no = [$i - 1, $j + 1];
            my $sw = [$i + 1, $j - 1];
            my $so = [$i + 1, $j + 1];

            if (
                ($data->[$nw->[0]]->[$nw->[1]] eq $data->[$no->[0]]->[$no->[1]] && $data->[$sw->[0]]->[$sw->[1]] eq $data->[$so->[0]]->[$so->[1]]) ||
                ($data->[$nw->[0]]->[$nw->[1]] eq $data->[$sw->[0]]->[$sw->[1]] && $data->[$no->[0]]->[$no->[1]] eq $data->[$so->[0]]->[$so->[1]])
            ) {
                my $valid = 1;
                my $m_count = 0;
                my $s_count = 0;
                foreach my $s ($data->[$nw->[0]]->[$nw->[1]], $data->[$no->[0]]->[$no->[1]], $data->[$sw->[0]]->[$sw->[1]], $data->[$so->[0]]->[$so->[1]]) {
                    $m_count +=1 if $s eq 'M';
                    $s_count +=1 if $s eq 'S';
                }
                $matches +=1 if ($m_count == 2 && $s_count == 2);
            }
        }
    }
}


print $matches;
